import React from 'react';
import Home from './Pages/Home';
import { BrowserRouter, Routes, Route } from 'react-router-dom';
import SignUp from '../src/Pages/SignUp'

const App = () => {
  return (
    <div>
        <Home />
      <BrowserRouter>
        <Routes>
        <Route path="/register" element={<SignUp />} />
        </Routes>
    </BrowserRouter>

    </div >
  );
};

export default App;
